import React from 'react';
import { SearchMealByName } from "../../services/mealtService";
import './index.css';

const MealPreviwGrid = () => {
	const comidas = SearchMealByName();

	return (
		<div className='meal-grid'>
		<div>{comidas}</div>
			
		</div>
	);
};

export default MealPreviwGrid;
